import logo from './logo.svg';
import './App.css';
import React,{useState, useEffect} from "react";




const App=()=> {

  const [starship, setStarship] = useState({});

  useEffect(()=>{
    fetch("https://swapi.dev/api/starships/9")
    .then((res)=>{
      console.log(res);
      res.json();
    })
    .then((res)=>{console.log(res)})
    .catch((res)=>{console.log(res)})
  },[])

  return (
    <div className="App">

    </div>
  );
}

export default App;
